import React from 'react';

import AwesomeButton from 'react-awesome-button/src/components/AwesomeButton';
import 'react-awesome-button/dist/themes/theme-blue.css';

import Slideshow from './AutoSwipe/SlideShow';
import slide1 from "../assets/bgBanner1.jpg";
import slide2 from "../assets/bgBanner2.jpg";
import slide3 from "../assets/bgBanner3.jpg";
import slide4 from "../assets/bgBanner4.jpg";
import slide5 from "../assets/bgBanner5.jpg";

const slides = [slide1, slide2, slide3, slide4, slide5];

const Banner = () => (
    <div className="block">
			<section className="hero is-fullheight" id="banner">
        <div className="columns is-gapless" id="tophead">
        	<div className="column about-single-element">
        		<i className="fa fa-exchange" aria-hidden="true"></i>
        		<p>Satisfait ou échangé</p>
        	</div>
        	<div className="column about-single-element">
        		<i className="fa fa-tree" aria-hidden="true"></i>
        		<p>Bois 100% français</p>
        	</div>
        	<div className="column about-single-element">
        		<i className="fa fa-truck" aria-hidden="true"></i>
        		<p>Livraison gratuite</p>
        	</div>
        	<div className="column about-single-element" id="headcall">
        		<i className="fa fa-phone" aria-hidden="true"></i>
        		<p>Appellez moi au 07 00 00 00 00 ou <a href="/#">contactez-moi ici</a></p>
        	</div>
        </div>
        <Slideshow slides={slides} />
			</section>
		</div>
);

export default Banner;
